import {Recipe} from './recipe.model';
import {EventEmitter, Injectable} from '@angular/core';
import {Ingredient} from '../shared/ingredient.model';
import {ShoppingListService} from '../shopping-list/shopping-list.service';

@Injectable()
export class RecipeService {
  recipeSelected = new EventEmitter<Recipe>();
  private recipes: Recipe[] = [
    new Recipe('Burger',
      'A simple test description of burger',
      'https://www.wearesovegan.com/wp-content/uploads/2018/03/SV_GreenBurger_V1_Header1.jpg', [
        new Ingredient('Cheeze', 10),
        new Ingredient('Meat', 1)
      ]),
    new Recipe('Pizza',
      'A simple test description of pizza',
      'data:image/jpeg;base64,', [
        new Ingredient('Mashroom', 10),
        new Ingredient('Cheeze', 2)
      ])

  ];

  constructor(private shoppinglistService: ShoppingListService) {}
  getRecipes() {
    return this.recipes.slice();
  }

  addIngredientsToShoppingList(ingredients: Ingredient[]) {
    this.shoppinglistService.addIngredients(ingredients);
  }

}
